	FUNCTION Test-Credentials
	{
		
		[cmdletbinding()]
		PARAM (
			[PARAMETER(Mandatory = $true, Position = 0)]
			[ValidateSet('Domain', 'Local')]
			$Context,
			
			[PARAMETER(Mandatory = $true, Position = 1)]
			[string]$theUN,
			
			[PARAMETER(Mandatory = $true, Position = 2)]
			[string]$thePW,
			
			[PARAMETER(Mandatory = $false)]
			[string]$DomainName
		)
		
		SWITCH ($Context)
		{
			'Domain' {
				IF (!$DomainName) { $quitNow = $true }
				ELSE
				{
					$theContext = 'Domain'
					$Principal = $DomainName
				}
			}
			'Local' {
				$theContext = 'Machine'
				$Principal = $env:COMPUTERNAME
			}
		}
		
		Add-Type -AssemblyName System.DirectoryServices.AccountManagement
		$DS = New-Object System.DirectoryServices.AccountManagement.PrincipalContext($theContext, $Principal)
		$DS.ValidateCredentials($theUN, $thePW)
		
	}
	
	FUNCTION Install-PaaS
	{
		PARAM (
			[PARAMETER(Mandatory = $true)]
			[ValidateNotNullOrEmpty()]
			[string]$DisplayName,
			
			[PARAMETER(Mandatory = $true)]
			[string]$ServiceNAme_NoSpacesAllowed,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateNotNullOrEmpty()]
			[string]$Description,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateNotNullOrEmpty()]
			[string]$SvcAccountUN,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateNotNullOrEmpty()]
			[string]$SvcAccountPW,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateSet('SERVICE_AUTO_START', 'SERVICE_DELAYED_START', 'SERVICE_DEMAND_START', 'SERVICE_DISABLED')]
			$StartupType,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateScript({ ([System.IO.File]::Exists($($_))) })]
			[string]$PS1,
			
			[switch]$StartNow,
			
			[string]$PaaSdir = "$($env:ProgramFiles)\PaaS",
			
			[string]$NssmExeInBase64 = ""
		)
		
		BEGIN
		{
			Log-Status -Status "Exporting required files...please be patient" -Icon Success
			IF ((Test-Path $PaaSdir) -eq $false){ New-Item $PaaSdir -ItemType Directory -Force | Out-Null }
			
			FUNCTION Convert_Export-File
			{
				PARAM (
					[Parameter(Mandatory = $true, Position = 0)]
					[ValidateNotNullOrEmpty()]
					[string]$File,
					
					[Parameter(Mandatory = $true, Position = 1)]
					[ValidateNotNullOrEmpty()]
					[string]$ExportTo
				)
				
				TRY{
					IF (-not (Test-Path -Path $ExportTo)){ 
						$bytes = [System.Convert]::FromBase64String($File)
						$null = [System.IO.File]::WriteAllBytes($ExportTo, $bytes)
						Start-Sleep -Milliseconds 100					
						IF (Test-Path $ExportTo){ return $true }
						ELSE { return $false }
	                }
					IF (Test-Path -Path $ExportTo){ return $true }
				}			
				CATCH { Write-Error "The following error was encountered: $($_) :EndError" }			
			}		
		}
		
		PROCESS
		{
			TRY {
	        
				IF (($PSBoundParameters["StartupType"] -eq "SERVICE_DISABLED") -and ($PSBoundParameters["StartNow"]))
				{
					Log-Status -Status "'StartupType'='Disabled' | 'StartNow'='True' |" -Icon Warning
					Log-Status -Status "The above configuration is not allowed, changing 'StartNow'='False'" -Icon Error
					Log-Status -Status "Your service will NOT be started immediately after installation!" -Icon Error
					$StartNow = $false
					$DoNotStartService = $true
				}
				
				$NssmExeExportResult = Convert_Export-File -File $NssmExeInBase64 -ExportTo "$PaaSdir\NSSM.exe"
							
				IF($NssmExeExportResult)
				{
					Log-Status -Status "Successfully exported all files" -Icon Success				
					Start-Sleep -Milliseconds 100				
					Invoke-Command -ScriptBlock { &$PaaSdir\NSSM.exe install "$ServiceNAme_NoSpacesAllowed" "$PS1" }				
					Start-Sleep -Seconds 3
					
					# Need to stop the service, if it is running, so we can set some more items
					if ((Get-Service -Name $ServiceNAme_NoSpacesAllowed -ErrorAction SilentlyContinue -WarningAction SilentlyContinue).Status -eq "Running") {
						$null = Stop-Service -Name $ServiceNAme_NoSpacesAllowed -Force -WarningAction SilentlyContinue -ErrorAction SilentlyContinue
					}
					
					[string]$AppDir = ($PS1.Replace(":\", ":::").Split("\") | Select-Object -SkipLast 1).Replace(":::", ":\")
					
					Invoke-Command -ScriptBlock { &$PaaSdir\NSSM.exe set "$ServiceNAme_NoSpacesAllowed" Start "$StartupType" }
					Start-Sleep -Milliseconds 100
					Invoke-Command -ScriptBlock { &$PaaSdir\NSSM.exe set "$ServiceNAme_NoSpacesAllowed" Description "$Description" }
					Start-Sleep -Milliseconds 100
					Invoke-Command -ScriptBlock { &$PaaSdir\NSSM.exe set "$ServiceNAme_NoSpacesAllowed" DisplayName "$DisplayName" }
					Start-Sleep -Milliseconds 100
					Invoke-Command -ScriptBlock { &$PaaSdir\NSSM.exe set "$ServiceNAme_NoSpacesAllowed" ObjectName "$SvcAccountUN" "$SvcAccountPW" }
					Start-Sleep -Milliseconds 100
					Invoke-Command -ScriptBlock { &$PaaSdir\NSSM.exe set "$ServiceNAme_NoSpacesAllowed" AppDirectory "$AppDir" }
					Start-Sleep -Milliseconds 300
					
					$DescRes = Get-WmiObject -Class Win32_Service | Where-Object { $_.Name -eq $ServiceNAme_NoSpacesAllowed } | Select-Object -ExpandProperty Description
					IF ($DescRes -eq $Description) { Log-Status -Status "Set service description" -Icon Success }
					IF ($DescRes -ne $Description) { Log-Status -Status "Error setting service description" -Icon Error }			
					Start-Sleep -Milliseconds 300
					$sType = Get-WmiObject -Class Win32_Service | Where-Object { $_.Name -eq $ServiceNAme_NoSpacesAllowed } | Select-Object -ExpandProperty StartMode
					
					SWITCH($sType)
					{
						'Auto' { IF(($StartupType -eq "SERVICE_AUTO_START") -or ($StartupType -eq "SERVICE_DELAYED_START")){ Log-Status -Status "Set service startup type" -Icon Success } }					
						'Manual' { IF($StartupType -eq "SERVICE_DEMAND_START"){ Log-Status -Status "Set service startup type" -Icon Success } }										
						'Disabled' { IF($StartupType -eq "SERVICE_DISABLED"){ Log-Status -Status "Set service startup type" -Icon Success } }					
						default { Log-Status -Status "Error setting service startup type" -Icon Error }
					}
							
					Start-Sleep -Milliseconds 200
					$startName = Get-WmiObject -Class Win32_Service | Where-Object { $_.Name -eq $ServiceNAme_NoSpacesAllowed } | Select-Object -ExpandProperty StartName
					IF ($startName -eq $SvcAccountUN) { Log-Status -Status "Set service account for service" -Icon Success }
					IF ($startName -ne $SvcAccountUN) { Log-Status -Status "Error setting service account for service" -Icon Error }
					
					IF ($StartNow) {
						Log-Status -Status "StartNow:TRUE; Starting service" -Icon Warning
						Invoke-Command -ScriptBlock { &$PaaSdir\NSSM.exe start "$ServiceNAme_NoSpacesAllowed" }
						Log-Status -Status "Service Started" -Icon Success
					}
					
					#return Get-Service -Name $ServiceName | Select-Object *				
				}			
				IF(-not $NssmExeExportResult){ Log-Status -Status "Unable to export NSSM.exe!" -Icon Error }
			}
			
			CATCH{
				$isPathError = $null
				$isModuleError = $null
				$line = $_.InvocationInfo.Line
				Log-Status -Status "[PROCESS:TRY:CONVERT]error: $($_) AT LINE: $($line) :enderror" -Icon Error
			}
		}	
		END { }
	}
	
